  const navigate = useNavigate();//V6的路由导航

  useEffect(() => {
    // if (!jwt.loadToken()){
    //   navigate('/login')
    // } 

    if (!window.token) {
      navigate('/login')
    }
  }, []);

  


  return (
  
    <div className={s.main}>
      
    </div>
  )


}

export default  inject('store')(observer(Index))
